import React from 'react';
import { useNavigate } from 'react-router-dom';

const Footer = () => {
  const navigate = useNavigate();

  const handleNavigation = (hash) => {
    // Przejście do strony głównej + hash
    navigate(`/#${hash}`);

    // Ręczny scroll (upewnij się, że sekcja istnieje)
    setTimeout(() => {
      const element = document.getElementById(hash);
      if (element) {
        element.scrollIntoView({ behavior: 'smooth' });
      } else {
        window.scrollTo(0, 0);
      }
    }, 100);
  };

  return (
    <section className="flex flex-col md:flex-row items-start justify-between w-full px-8 py-12 gap-12 bg-white text-black mq450:px-4">
      {/* Lewa kolumna */}
      <div className="flex flex-col items-start gap-6">
        <div className="flex flex-col gap-5">
          <img
            src="/teraz-cash--logo-1.svg"
            alt="Logo"
            className="w-[194.7px] h-8 cursor-pointer"
            onClick={() => navigate('/')}
            loading="lazy"
          />
          <p className="font-medium text-lg mq450:text-base">
            Twoje finanse, Twoje zasady!
          </p>
          <div className="flex gap-3">
            <img src="/icon-1.svg" alt="" className="w-8 h-8 rounded-full" />
            <img src="/icon-2.svg" alt="" className="w-8 h-8 rounded-full" />
            <img src="/icon-3.svg" alt="" className="w-8 h-8 rounded-full" />
            <img src="/icon-4.svg" alt="" className="w-8 h-8 rounded-full" />
          </div>
        </div>
        <div className="flex flex-col gap-1 text-sm">
          <div>Blockbridge sp. z o. o.</div>
          <div>Święty Marcin 29 / 8, 61-806 Poznań, Polska</div>
          <div>© 2024 terazcash</div>
        </div>
      </div>

      {/* Środkowa kolumna (dodatkowa lokalizacja) */}
      <div className="hidden lg:flex flex-col gap-6 text-base">
        <div className="flex flex-col gap-1">
          <div className="font-medium">Teraz.cash</div>
          <div className="font-medium">9647 Carroll Canyyon RD</div>
          <div className="font-medium">San Diego CA 90138-4703, USA</div>
          <div className="font-medium">EIN 06-0860202</div>
        </div>
        <div className="flex flex-col gap-1">
          <div className="font-medium">office@teraz.cash</div>
          <div className="font-medium">+1 003 003 3000</div>
          <div className="font-medium">www.teraz.cash</div>
        </div>
      </div>

      {/* Prawa kolumna */}
      <div className="flex flex-col md:flex-row gap-16 w-full md:w-auto text-base">
        <div className="flex flex-col gap-5">
          <h4 className="font-bold text-lg">Regulaminy</h4>
          <div
            className="cursor-pointer underline font-medium"
            onClick={() => navigate('/pp')}
          >
            Polityka prywatności
          </div>
          <div
            className="cursor-pointer underline font-medium"
            onClick={() => navigate('/regulamin')}
          >
            Regulamin świadczenia usług
          </div>
          <div
            className="cursor-pointer underline font-medium"
            onClick={() => navigate('/aml')}
          >
            Informacja o polityce AML
          </div>
        </div>

        <div className="flex flex-col gap-5">
          <h4 className="font-bold text-lg">Nawigacja</h4>
          <div
            className="cursor-pointer font-medium"
            onClick={() => handleNavigation('o-nas')}
          >
            O Nas
          </div>
          <div
            className="cursor-pointer font-medium"
            onClick={() => handleNavigation('fands')}
          >
            Funkcje i Usługi
          </div>
        </div>
      </div>
    </section>
  );
};

export default Footer;
